Vogliamo scrivere un'algoritmo che ci dica se un elemento si trova all'interno di una sequenza ordinata . Una soluzione può prevedere sicuramente di scorrere tutti gli elementi: bool contains(const vector<int>& sequenza, int elemento_da_trovare) { for (int elemento : sequenza) { // Se abbiamo trovato l'elemento allora l'elemento è contenuto all'interno della sequenza: sequenza contains elemento_da_trovare = true. if (elemento == elemento_da_trovare) return true; } // Nessun elemento è uguale a `elemento_da_trovare`: sequenza contains elemento_da_trovare = true. return false;
} Questa soluzione è lineare nel caso pessimo (e medio). Possiamo sfruttare il fatto che la sequenza sia ordinata a nostro vantaggio: possiamo controllare un elemento a caso: se è uguale all'elemento da trovare allora abbiamo concluso. se è maggiore dell'elemento da trovare allora questo si troverà alla sua "sinistra" (ordinamento crescente). se è minore allore si troverà alla sua "destra". Dal momento che vogliamo ottimizzare il caso medio/pessimo, ha senso fare in modo che la partizione "sinistra" e "destra" abbiano la stessa dimensione : con una partizione sbilanciata otteniamo una maggiore probabilità che l'elemento da trovare si trovi nella partizione più grande, e più la partizione è grande più è difficile trovare l'elemento. Andremo dunque a verificare l'elemento che si trova a metà della partizione che stiamo valutando. Esempio: vogliamo ricercare il numero 3 all'interno della sequenza 1 2 3 4 5 6 7 8 9. controlliamo il 5 che si trova a metà: ci dice che dobbiamo ricercare il 3 in 1 2 3 4 dal momento che è più grande. controlliamo il 2 (dipende dall'implementazione): ci dice che dobbiamo ricercare il 3 in 3 4. controlliamo il 3 che effettivamente ci dice che l'elemento è presente nella sequenza. Esempio: vogliamo ricercare il numero 3 all'interno della sequenza 1 2 4 5 6 7 8 9. controlliamo il 5: 1 2 4. controlliamo il 2: 4. controlliamo il 4: otteniamo una partizione vuota che ci dice che l'elemento non esiste . La complessità di questo algoritmo è logaritmica nel caso pessimo ! La dimensione della partizione viene dimezzata ad ogni passaggio, quindi anche con una sequenza di \(2^{100}\) elementi, dopo soli \(100\) passaggi avremo individuato l'elemento. Con l'altro algoritmo ci sarebbero voluti (al peggio) \(2^{100}\) passaggi. Viene presentata una possibile implementazione: // `from` inclusivo, `to` esclusivo.
bool contains(const vector<int>& sequenza, int from, int to, int elemento_da_trovare) { // Abbiamo una sequenza di 0 elementi: false. if (from >= to) return false; // Indice del valore che si trova in mezzo fra `from` e `to`. // ps: si poteva fare (from + to) / 2. // Tuttavia questa scrittura permette di non avere overflow. // È inoltre concettualmente più corretta quando si ha a che fare con iteratori. int mid = from + (from - to) / 2; if (sequenza.at(mid) == elemento_da_trovare) { // Abbiamo trovato l'elemento. return true; } else if (sequenza.at(mid) > elemento_da_trovare) { // L'elemento sta a "sinistra". return contains(sequenza, from, mid, elemento_da_trovare); } else /* if (sequenza.at(mid) < elemento_da_trovare) */ { // L'elemento sta a "destra". return contains(sequenza, mid + 1, to, elemento_da_trovare); }
}

